column8:
●入浴後やおやすみ前に手軽に使え、疲れた足をひんやり爽快にします<br>
●水をたっぷり含み、冷却効果を発揮します<br>
●お肌にやさしい高含水タイプ<br>
●ハーブ成分配合<br>
<br><hr><br>
【使用方法】<br>
●透明フィルムをはがし、冷やしたい部分に貼ってください。<br>
●冷蔵庫に入れておくと、さらに高い冷却効果が得られます。<br>
　（冷凍庫には入れないでください。）<br>
●冷感を感じなくなったらお貼り替えください。<br>
●水にぬれていたり汗をかいている場合はよくふいてからご使用ください。<br>
<br><hr><br>
【ご注意】<br>
●直射日光や高温の場所を避けて保管してください。<br>
●開封後はアルミ袋をしっかりと折り曲げ、未使用分が乾燥しないように保管してください。<br>
●シートを貼ったまま靴をはくと靴や靴下に基剤が付着することがありますのでご注意ください。<br>
●小児に使用させる場合には、保護者の指導監督のもとに使用させてください。<br>
●目の周囲、粘膜及び傷口、湿疹、かぶれ等皮膚に異常のある部位には使用しないでください。<br>
●発赤・かゆみ等皮膚に異常があらわれた時は使用を中止してください。<br>
●本品は医薬品ではありません。疾患の冷却等については医師にご相談ください<br>
<br><hr><br>
【成分】<br>
L-メントール、ポリソルベート80、エデト酸塩、色素配合<br>
<br><hr><br>
【製造販売元】<br>
東和製薬株式会社<br>
和歌山県紀の川市貴志川町丸栖1229番地<br><br>区分： 化粧品<br><br><hr>広告文責：株式会社モリキ<br>電話：0269-38-0611<br><style type="text/css">
